description:
Big Bad Noise is the second album by Aussie rock band Choirboys which was released in 1987. It featured their number one hit and most popular song &quot;Run To Paradise&quot;. It also spawned two other top 30 singles Boys Will Be Boys and Struggletown. This album was produced by Peter Blyton, Bryan MaGee and Choirboys.

